import React from "react";
import styled, { css } from "styled-components";

const HeaderBlock = styled.div`
  max-width: 1280px;
  height: 717px;
  margin: 0 auto;
  box-sizing: border-box;
  padding-left: 40px;
  padding-right: 40px;
`;
function MainHeader() {
  return (
    <HeaderBlock>
      <MainBanner />
    </HeaderBlock>
  );
}

export default MainHeader;
